import React, { Component } from "react";
import { Link } from "react-router-dom";
import platzhalter from './platzhalter.png';

class Navbar extends Component {
  render() {
    return (
      <div className="navbar-fixed">
        <nav className="z-depth-0">
          <div>
              <img src={platzhalter} alt="Platzhalter" />
          </div>
          <div className="nav-wrapper white">
            <Link
              to="/"
              style={{
                fontFamily: "monospace"
              }}
              className="col s5 brand-logo center-left black-text"
            >
              <i className="material-icons">code</i>
              MERN
            </Link>
            <Link
                to="/login"
                style={{
                  width: "140px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect grey right black-text"
            >
              Log In
            </Link>
            <Link
                to="/myaccount"
                style={{
                    width: "140px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                My Account
            </Link>
            <Link
                to="/mystats"
                style={{
                    width: "140px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                My Statistics
            </Link>
            <Link
                to="/login"
                style={{
                width: "140px",
                borderRadius: "3px",
                letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                Log In
            </Link>
            <Link
                to="/leaderboard"
                style={{
                    width: "140px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
              >
                  Leaderboard
            </Link>
            <Link
                to="/forum"
                style={{
                width: "140px",
                borderRadius: "3px",
                letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                Forum
            </Link>
          </div>
        </nav>
      </div>
    );
  }
}
export default Navbar;
